import PicMain from "../assets/PicMain.png";
import facebook from "../assets/facebook.png";
import instagram from "../assets/instagram.png";
import youtube from "../assets/youtube.png";
import github from "../assets/github.png";
import '../components/Home.css';
export const Home = () => {
    return(
        
    <div className="content">
      <div className="contentLeft">
      <h2 className="h2ContentLeft">สวัสดี, </h2>
      <h1 className="h1ContentLeft">I'm <span className="spanContentLeft">Attapol Kerdlamjiak</span></h1>
      <p className="textContent">
      Hello, my name is Attapol i'm year 4 Major Computer Engineering Rangsit University.This is Portfolio Website Final Project by React
      </p>
     <ul>
      <li><a href="https://www.facebook.com/autapol1234/" target="_blank"><img src={facebook} className="imgFacebook"/></a></li>
      <li><a href="https://www.instagram.com/hofaka1234" target="_blank"><img src={instagram} className="imgFacebook"/></a></li>
      <li><a href="https://www.youtube.com/channel/UCV95M_3Qw-YoD89530uJEMQ"target="_blank"><img src={youtube} className="imgFacebook"/></a></li>
      <li><a href="https://github.com/attapol2ten"target="_blank"><img src={github} className="imgFacebook"/></a></li>
     </ul>
     <div className="contentBottom"><a className="button" href="mailto:autapol0074@gmail.com">Contact me</a>
      </div>
    </div>
    <div className="contentRight"><img src={PicMain} className="imgProfile"/></div>
  </div>
  
    )
}
<NavLink style={ActiveNavbar}  to='/about' className="colorNav2">
               About me
                </NavLink>
